/*
const Course = ({ course}) => {
    const total = course.reduce(
        (a, b) => a + b.parts.exercises,
        0
    );
  
return (
    <div>
            {course.map(index =>
        <ul key={index.id}>
        {index.name}
         </ul>
            )} 
          {course.map(index =>
          <ul key={index.parts}>
              {console.log(index.exercises)}
              {index.exercises}
          </ul>
            )}  
            total of {total} exercises
           
    </div>
)
}
*/

const Part = (props) => {
    return (
    <div>
    {props.name} {props.exercises}
    </div>
    )
}
/*
const Sum = ({course}) => {
    const sum = course.map(part => part.exercises)

    return (
        <div>
      Total {sum.reduce((a,b) => a +b)} of exercises
        </div>
    )
}
*/

const Content = ({course}) => {
    return (
        <div>
            {course.map( index => 
            <Part key={index.id} name={index.parts.name} exercises={index.parts.exercises}/>  )}
        </div>
    )
}

const Header = ({course}) => {
    console.log(course.name)
    return (
<h1>
    {course[1].parts.name}
    {course.map(index =>
    <ul key={index.id}>
        {index.name}
    </ul>
        )}
</h1>
    )
}

const Course = ({course}) => {  
  
    return (
        <div>
            <Header course={course} />
            <Content course={course} />
           
        </div>
  )
}

export default Course
